import { GET_PROFILE } from "../actions/types";

const initialState = {
  profile: undefined,
  profiles: [],
  repos: [],
  loading: true,
  error: {}
}

export default function profileReducer(state=initialState, action) {
  const { type, payload } = action;

  switch(type) {
    case GET_PROFILE:
      return state;
    default:
      return state;
  }

}
